// import { useState } from 'react';
import './App.css';

function App() {

  const onSubmitHandler = async (e) => {
    e.preventDefault()

    await fetch('https://api.publicapis.org/entries', {
      method: 'POST',
      mode: 'no-cors',
    })
  }

  return (
    <div className="App">
      <button 
        className="button"
        onClick={onSubmitHandler}
      >
        Get Recommendations!
      </button>
    </div>
  );
}

export default App;
